import "./cardsfilter.css"
function Sir(){
    const update=()=>{
       const input=document.getElementById("filter").value.toUpperCase()
       const card=document.getElementsByClassName("item")
       for(let i=0;i<card.length;i++){
        var title= card[i].querySelector(".card-title")
        if(title.innerText.toUpperCase().indexOf(input)>-1){
            card[i].style.display=""
        }
        else{
            card[i].style.display="none"
        }
    }
     
    }
    const btn=document.getElementsByTagName("a")
    const select=document.querySelector(".select")
    const n=document.querySelector("h1")
    for(var b of btn){
    b.addEventListener("click",(e)=>{
        var parent=e.target.parentNode;
        //clonenode-->it move one list to another list
        var clone=parent.cloneNode(true)
        select.appendChild(clone)
        if(clone){
            n.onclick=function(){
                select.classList.toggle("display")
            }
        }
    })
  }
    return(
        <section>
            <h1><i class="fa fa-shopping-cart"></i></h1> 
            <input type="text" id="filter" placeholder="filter" onKeyUp={update}></input>
            <div className="item">
                <img src="http://pksmbd.co.in/img/images/python1.png"/>
                <p></p>
                <h4>Fees:Rs.10000</h4>
                <h3 className="card-title">Python</h3>
                <button>Add-cart</button>
            </div>
            <div className="item">
                <img src="https://miro.medium.com/v2/resize:fit:336/1*Kbu_OnGEVUCvfMPYnj191g.png"/>
                <p></p>
                <h4>Fees:Rs.10000</h4>
                <h3 className="card-title">HTML</h3>
                <button>Add-cart</button>
            </div>
            <div className="item">
                <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSOHJnPqfUzVU2SYaxWflNJgWW7yM9dkXl0_g&usqp=CAU"/>
                <p></p>
                <h4>Fees:Rs.10000</h4>
                <h3 className="card-title">Css</h3>
                <button>Add-cart</button>
            </div>
            <div className="item">
                <img src="https://media.istockphoto.com/id/1284271878/photo/javascript-inscription-against-laptop-and-code-background-learn-javascript-programming.jpg?b=1&s=170667a&w=0&k=20&c=pNyw5iN2ee3oK5adyRBr9-w1cPh9hkUGGnc5Q4JfyJM="/>
                <p></p>
                <h4>Fees:Rs.10000</h4>
                <h3 className="card-title">Javascript</h3>
                <button>Add-cart</button>
            </div>
            <div className="item">
                <img src="https://pbs.twimg.com/card_img/1633238709574287360/vh7tnUxI?format=png&name=medium"/>
                <p></p>
                <h4>Fees:Rs.10000</h4>
                <h3 className="card-title">React Js</h3>
                <button>Add-cart</button>
            </div>
            <div className="item">
                <img src="https://www.developer.com/wp-content/uploads/2021/09/Java-tutorials.jpg"/>
                <p></p>
                <h4>Fees:Rs.10000</h4> 
                <h3 className="card-title">Java</h3>
                <button>Add-cart</button>
            </div>
            <div className="select">

            </div>
        </section>
    )
}
export default Sir;
